$(document).ready(function(){var i=$(".single-item, .multiple-items");i.each(function(){$(this).is(".single-item")?$(this).slick({arrows:!1,dots:!0,autoplay:!0,autoplaySpeed:5e3}):$(this).is(".multiple-items")?$(this).slick({infinite:!0,autoplay:!0,autoplaySpeed:3e3,slidesToShow:3,slidesToScroll:2}):$(this).slick()}),$(".counter").counterUp({delay:10,time:1e3})});